import { useState } from 'react';

function useStats() {
  const [stats, useStats] = useState();
  useEffect(() => {
    async function fetchData() {
      console.log('fetching data');

      fetch('https://covid19.mathdro.id/api').then(data => data.json);
    }
  }, []);
}

export default function IndexPage() {
